		function moveBalls() {
			var tempbb;
			var tempb2;
			for (var ii = mcsbinnen.length-1;ii>=0;ii--) {
				tempbb = mcsbinnen[ii];
				tempbb.vx *= .97;
				tempbb.vy *= .97;
				tempbb.vy += .7;
				var fx = 0.0;
				var fy = 0.0;
				for (var i = mcsbinnen.length-1;i>=0;i--) {
					tempb2 = mcsbinnen[i];
					var dx;
					var dy;
					var dist;
					dx = tempbb.x - tempb2.x;
					dy = tempbb.y - tempb2.y;
					dist = Math.sqrt(dx*dx+dy*dy);
					if (tempbb!=tempb2 && dist<2*cBallRadius) {
						dx = (tempbb.x+tempbb.vx) - tempb2.x;
						dy = (tempbb.y+tempbb.vy) - tempb2.y;
						dist = Math.sqrt(dx*dx+dy*dy);
						var dmax = cBallRadius+cBallRadius - dist;
						if (dmax > 0) {
							var mag1 = dmax*.5/dist;
							fx += dx*mag1;
							fy += dy*mag1;
						}
					}
				}
				tempbb.vx += fx;
				tempbb.vy += fy;
				// bounce off floor and ceiling
				if (tempbb.y+cBallRadius+tempbb.vy>=720) {
					tempbb.vy *= -.5;
				}
				// bounce off right and left wall
				if ((tempbb.x-cBallRadius) + tempbb.vx <= 0 || tempbb.x+cBallRadius + tempbb.vx >= 960) tempbb.vx *= -.5;
				//reduce bibber
				if (tempbb.vx < .3 && tempbb.vx > -.3) tempbb.vx = 0;
				if (tempbb.vy < .3 && tempbb.vy > -.3) tempbb.vy = 0;
				if(tempbb.vx>1||tempbb.vx<-1)tempbb.x+=tempbb.vx;
				if (tempbb.vy > 1 || tempbb.vy < -1) tempbb.y += tempbb.vy;
			}
		}
